import React from "react";
import { Container, Row, Col, Image } from "react-bootstrap";
import Footer from "../Footer/Footer";
import "./Contact.scss";
import linkedin from "../../assets/icons/linkedin.png";
import github from "../../assets/icons/github.png";

function Contact() {
  return (
    <section className="contact">
      <h1 className="contact__title"> Reach us at:</h1>
      <Container className="contact__contain">
        <Row className="contact__contain--row">
          <Col className="contact__contain__col">
            <Image className="contact__contain--icon" src={linkedin} rounded />
          </Col>
          <Col className="contact__contain__col">
            <Image className="contact__contain--icon" src={github} rounded />
          </Col>
        </Row>
      </Container>
      <Footer />
    </section>
  );
}

export default Contact;
